import * as React from "react";
import { useState, useEffect, Component } from "react";
import styles from "./Header.module.scss";
import "../../External/style.css";
import * as moment from "moment";
import { graph } from "@pnp/graph/presets/all";
import { sp } from "@pnp/sp/presets/all";
import {
  CommandBarButton,
  IContextualMenuProps,
  Icon,
  Label,
} from "@fluentui/react";

export interface IHeaderDetail {
  ID: number;
  Title: string;
  URL: string;
  SubFolderFor: string;
  isActive: boolean;
  isDelete: boolean;
  isMain: boolean;
}

export interface IRMData {
  ID: number;
  Description: string;
  StartDate: Date;
  EndDate: Date;
  isActive: boolean;
  isDelete: boolean;
}

export interface IHead {
  Title: string;
  URL: string;
  isSelect: boolean;
  _item?: IContextualMenuProps;
}

let _arrHeader: IHeaderDetail[] = [];
let _arrADSuperAdminUsers: string[] = [];
let _arrADUser: string[] = [];
let _isSuperdmin: boolean = false;
let _isRMAdmin: boolean = false;
let _curUser: string = "";

// dev
let AugustBioSuperAdminId: string = "50f13710-3dcf-4be6-b2fe-fbacfc6729f6";
let HQLId: string = "20164e3d-ce5e-44f8-a0f3-1a0852440918";
let RMessageList: string = "UrgentBannerList";
let HeaderDetail: string = "HeaderList";
let _curPageSiteUrl: string =
  "https://chandrudemo.sharepoint.com/sites/AugustBioServices";

const ReactHeader = () => {
  // Local variable creations
  const _comLogo: string =
    "data:image/png;base64,";

  // State creations
  const [isLoader, setIsLoader] = useState<boolean>(true);
  const [HeaderDatas, setHeaderDatas] = useState<IHead[]>([]);
  const [RMessageData, setRMessageData] = useState<string>("");

  // Functions creations
  const _getErrorFun = (err: any): void => {
    setIsLoader(false);
  };

  const _getDefaultFun = (): void => {
    setIsLoader(true);
    _isSuperdmin = false;
    _isRMAdmin = false;
    _getCurUserDetail();
  };

  const _getCurUserDetail = async () => {
    let userProps: any = await sp.web.currentUser();
    _curUser = userProps.Email;
    _getADSuperAdminDetails();
  };

  const _getADSuperAdminDetails = async () => {
    await graph.groups
      .getById(AugustBioSuperAdminId)
      .members.top(999)()
      .then((Data: any) => {
        _arrADSuperAdminUsers = [];

        Data.length &&
          Data.forEach((e: any) => {
            _arrADSuperAdminUsers.push(e.userPrincipalName.toLowerCase());
          });

        _isSuperdmin = _arrADSuperAdminUsers.some(
          (e: string) => e === _curUser.toLowerCase()
        );

        _getADgroupDetails();
      })
      .catch((err: any) => {
        _getErrorFun(err);
      });
  };

  const _getADgroupDetails = async () => {
    await graph.groups
      .getById(HQLId)
      .members.top(999)()
      .then((Data: any) => {
        _arrADUser = [];

        Data.length &&
          Data.forEach((e: any) => {
            _arrADUser.push(e.userPrincipalName.toLowerCase());
          });

        _isRMAdmin = _arrADUser.some(
          (e: string) => e === _curUser.toLowerCase()
        );

        _getRMessageData();
      })
      .catch((err: any) => {
        _getErrorFun(err);
      });
  };

  const _getRMessageData = async () => {
    await sp.web.lists
      .getByTitle(RMessageList)
      .items.top(4000)
      .orderBy("Modified", false)
      .get()
      .then((res: any) => {
        let _curArray: IRMData[] = [];
        let _curMessage: string = "";
        let _curNews: string = "";

        if (res.length) {
          for (let i: number = 0; res.length > i; i++) {
            if (
              moment(res[i].StartDate).format("YYYYMMDD") <=
              moment(new Date()).format("YYYYMMDD") &&
              moment(res[i].EndDate).format("YYYYMMDD") >=
              moment(new Date()).format("YYYYMMDD") &&
              res[i].isActive === true &&
              res[i].isDelete === false &&
              res[i].isArchive === false
            ) {
              _curArray.push({
                ID: res[i].ID,
                Description: res[i].Description ? res[i].Description : "",
                StartDate: res[i].StartDate
                  ? new Date(res[i].StartDate)
                  : new Date(),
                EndDate: res[i].EndDate ? new Date(res[i].EndDate) : null,
                isActive: res[i].isActive ? true : false,
                isDelete: res[i].isDelete ? true : false,
              });

              _curNews += res[i].Description + " | ";
            }

            if (res.length === i + 1 && _curNews) {
              let _strArr: string[] = [];

              _strArr = _curNews.split(" | ");
              _strArr.pop();
              _curMessage = _strArr.join(" | ");
            }
          }
        }

        setRMessageData(_curMessage);
        _getHeaderDetails();
      })
      .catch((err: any) => {
        _getErrorFun(err);
      });
  };

  const _getHeaderDetails = async () => {
    await sp.web.lists
      .getByTitle(HeaderDetail)
      .items.top(4000)
      .orderBy("Modified", false)
      .get()
      .then((res: any) => {
        _arrHeader = [];

        if (res.length) {
          for (let i: number = 0; res.length > i; i++) {
            if (res[i].isActive === true && res[i].isDelete === false) {
              _arrHeader.push({
                ID: res[i].ID,
                Title: res[i].Title ? res[i].Title : "",
                URL: res[i].URL ? res[i].URL : "",
                SubFolderFor: res[i].SubFolderFor ? res[i].SubFolderFor : "",
                isActive: res[i].isActive ? true : false,
                isMain: res[i].isMain ? true : false,
                isDelete: res[i].isDelete ? true : false,
              });
            }
          }
        }

        _getPrepareArr();
      })
      .catch((err: any) => {
        _getErrorFun(err);
      });
  };

  const _getPrepareArr = (): void => {
    let _arrHead: IHead[] = [];
    let _curObj: IHead;
    let items: any[] = [];

    if (_arrHeader.length) {
      for (let i: number = 0; _arrHeader.length > i; i++) {
        if (_arrHeader[i].isMain === true) {
          _curObj = {
            Title: _arrHeader[i].Title,
            URL: _arrHeader[i].URL,
            isSelect: false,
          };

          for (let j: number = 0; _arrHeader.length > j; j++) {
            if (
              !_arrHeader[j].isMain &&
              _arrHeader[j].SubFolderFor === _arrHeader[i].Title
            ) {
              items.push({
                key: _arrHeader[j].ID,
                text: _arrHeader[j].Title,
                URL: _arrHeader[j].URL,
                onClick: () => {
                  _arrHeader[j].URL && window.open(_arrHeader[j].URL, "_blank");
                },
              });
            }

            if (_arrHeader.length === j + 1) {
              _curObj._item = { items };
              _arrHead.push({ ..._curObj });
              items = [];
            }

            if (_arrHeader.length === j + 1 && _arrHeader.length === i + 1) {
              setHeaderDatas([..._arrHead]);
              setIsLoader(false);
            }
          }
        }
        if (_arrHeader.length === i + 1) {
          setHeaderDatas([..._arrHead]);
          setIsLoader(false);
        }
      }
    } else {
      setHeaderDatas([..._arrHead]);
      setIsLoader(false);
    }
  };

  const _handleChange = (i: number): void => {
    let temp: IHead[] = [...HeaderDatas];

    temp.map((e: IHead) => (e.isSelect = false));

    temp[i].isSelect = true;

    setHeaderDatas([...temp]);
  };

  useEffect(() => {
    _getDefaultFun();
  }, []);

  return (
    !isLoader && (
      <div>
        {/* Rotating message section */}
        {RMessageData ? (
          <div className={styles._scrolling}>
            <Label
              style={{
                backgroundColor: "#510c76",
                zIndex: 2,
                position: "absolute",
                top: 0,
                left: 0,
                bottom: 0,
                height: 36,
                width: 36,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Icon
                iconName="Warning"
                style={{
                  color: "#ffff",
                }}
              />
            </Label>

            <div>{RMessageData}</div>

            {(_isSuperdmin || _isRMAdmin) && (
              <Label
                style={{
                  backgroundColor: "#510c76",
                  zIndex: 2,
                  position: "absolute",
                  top: 0,
                  right: 0,
                  bottom: 0,
                  height: 36,
                  width: 36,
                  display: "flex",
                  justifyContent: "center",
                  alignItems: "center",
                }}
              >
                <Icon
                  iconName="Edit"
                  style={{
                    color: "#ffff",
                    cursor: "pointer",
                  }}
                  onClick={() => {
                    window.open(
                      _curPageSiteUrl + "/SitePages/RotatingMSG.aspx",
                      "_self"
                    );
                  }}
                />
              </Label>
            )}
          </div>
        ) : _isSuperdmin || _isRMAdmin ? (
          <div className={styles._scrolling}>
            <Label
              style={{
                backgroundColor: "#510c76",
                zIndex: 2,
                position: "absolute",
                top: 0,
                left: 0,
                bottom: 0,
                height: 36,
                width: 36,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Icon
                iconName="Warning"
                style={{
                  color: "#ffff",
                }}
              />
            </Label>

            <div>No news available. Please add.</div>

            <Label
              style={{
                backgroundColor: "#510c76",
                zIndex: 2,
                position: "absolute",
                top: 0,
                right: 0,
                bottom: 0,
                height: 36,
                width: 36,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Icon
                iconName="Edit"
                style={{
                  color: "#ffff",
                  cursor: "pointer",
                }}
                onClick={() => {
                  window.open(
                    _curPageSiteUrl + "/SitePages/RotatingMSG.aspx",
                    "_self"
                  );
                }}
              />
            </Label>
          </div>
        ) : (
          ""
        )}

        {/* Header section */}
        <div className={styles.headerSection} style={{
          display: 'none'
        }}>
          <span className={styles.logoContainer}>
            <img width="200" height="70" src={_comLogo} />
          </span>

          <div className={styles.ButtonSection}>
            {HeaderDatas.length
              ? HeaderDatas.map((val: IHead, i: number) => {
                return val._item.items.length ? (
                  <CommandBarButton
                    text={val.Title}
                    menuProps={val._item}
                    className={
                      val.isSelect
                        ? styles.activeButton
                        : styles.inactiveButton
                    }
                    onClick={() => {
                      _handleChange(i);
                    }}
                  />
                ) : (
                  <CommandBarButton
                    text={val.Title}
                    className={
                      val.isSelect
                        ? styles.activeButton
                        : styles.inactiveButton
                    }
                    onClick={() => {
                      _handleChange(i);
                      val.URL && window.open(val.URL, "_blank");
                    }}
                  />
                );
              })
              : ""}

            {(_isSuperdmin || _isRMAdmin) && (
              <CommandBarButton
                text="Edit"
                onClick={() => {
                  window.open(
                    _curPageSiteUrl + "/SitePages/HeaderData.aspx",
                    "_self"
                  );
                }}
              />
            )}
          </div>
        </div>
      </div>
    )
  );
};

export default ReactHeader;
